import React from "react";
import "./error.css";
import { BiErrorCircle } from "react-icons/bi";

export const Error = () => {
  return (
    <div className="errorInput">
      <input type="text" />
      <BiErrorCircle className="errorIcon" />
    </div>
  );
};
